import React from "react";

const Software = () => {
  return (
    <div >
        <div style={{display: "flex", textAlign: "center"}}>
            <h1 style={{flex: 1}}>Familiar Languages</h1>
            <h1 style={{flex: 1}}>Familiar Tools</h1>
        </div>

        <h1 style={{paddingLeft: "3.3em"}}>Mentorship</h1>
        <h1>Projects</h1>
    </div>
  );
};

export default Software;
